import './App.css';
import React from 'react';

function App() {
  const movieList =[
    { title: "Heath Chang 1",
      year: 2001  
    },
    { title: "Heath Chang 2",
      year: 2002  
    },
    { title: "Heath Chang 3",
      year: 2003 
    }
  ]
  return (
    <div className="App">
      <h1>Heath Chang</h1>
      <div className="movie">
        <div>{movieList[0].title}</div>
        <div>{movieList[0].year}</div>
      </div>
    </div>

  );
}

export default App;
